import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class UserList extends Component {
  constructor(props) {
    super(props);

  }

  render() {
    return (
      <ul className="list-group">
        <li className="list-group-item"><Link to="/user/detail/1">Kevin</Link></li>
        <li className="list-group-item"><Link to="/user/detail/2">Joker</Link></li>
      </ul>
    );
  }
}

export default UserList;
